INSERT INTO `news` (`news_id`, `news_title`, `news_content`, `icon_id`, `created_at`, `updated_at`) VALUES
	(1, 'WELCOME TO STADIS', '<p>Web Stadis, merupakan sebuah WEBSITE yang mempermudah dalam melakukan request material code</p>', 108, '2022-10-28 08:02:09', '2022-11-04 06:11:29'),
	(4, 'STADIS Under Maintenance', '<p>Dear User, mohon maaf atas kendala yang dihadapi.<br>Saat ini STADIS sedang dalam perbaikan.&nbsp;</p><p>User yang akan Request Kode Material akan mengalami muncul error saat submit request. Jangan Khawatir! request anda tetap terekam.</p><p>Silahkan abaikan errornya, lalu klik menu Outstanding Material Master dan upload dokumen pendukung sebagai attachment.</p><p>&nbsp;</p>', 198, '2022-11-21 05:03:52', '2022-12-01 01:19:00'),
	(5, 'Flow Status Request', '<p><strong>How It Start</strong></p><ol><li>User mengisi data dengan lengkap pada form Request MM yang telah disesuaikan dengan jenis materialnya ( Maka akan mendapat status <strong>Not Yet Created</strong> )</li><li>User harus mengupload dokumen pendukung yang akan dilampirkan pada material master di SAP, format dokumen wajib .pdf ( status menjadi <strong>Request Created </strong>)</li><li>Tim Master Data akan memproses Request anda sebelum Material di registrasi ke SAP, Akan di verifikasi terlebih dahulu ( status <strong>On Process</strong> )</li><li>Jika setelah diverifikasi ternyata Request anda tidak dapat diregister ke SAP, maka tim Master Data akan memberikan alasan pada STADIS ( status <strong>Rejected </strong>)</li><li>Jika Request anda dapat di proses oleh Master Data ke SAP, maka anda akan mendapatkan notifikasi email, silahkan periksa kembali kelengkapan data di SAP maupun di STADIS untuk material yang telah terdaftar ( status <strong>Code Created</strong> )</li><li>Setelah kode material dirasa sudah cukup benar sesuai dengan Request, silahkan untuk klik tombol Accept agar Request anda berpindah dari Outstanding ke History. ( Jika sudah Klik tombol Accept maka status berubah menjadi <strong>Accepted </strong>)<br>&nbsp;</li></ol>', 146, '2022-12-15 05:56:52', '2022-12-15 05:56:52'),
	(6, 'Error STADIS', '<p>Dear All User, mohon maaf atas kendala yang dihadapi.<br>Saat ini STADIS sedang dalam perbaikan.&nbsp;</p><p>User yang akan Request Kode Material akan mengalami muncul error saat submit request. Jangan Khawatir! request anda tetap terekam.</p><p>Silahkan abaikan errornya, lalu klik menu Outstanding Material Master dan upload dokumen pendukung sebagai attachment.</p><p>Saat Master Data akan konfirmasi Material Master / Reject request, mengalami muncul error jangan Khawatir! Silahkan abaikan errornya, kemudian refresh, karena aktivitas yang dilakukan sudah terekam di sistem.</p>', 703, '2023-04-13 04:19:38', '2023-04-13 04:19:38'),
	(7, 'Announcement', '<p>Dear All User Web STADIS</p><p>Apabila ada error saat klik request kode material baru, mohon di screenshot dan di kirimkan ke email Administrator :</p><p><br><a href="mailto:Ayu.TaqiyaUlfa@ggpc.co.id">Ayu.TaqiyaUlfa@ggpc.co.id</a> &amp; Laksamana.wildan@terbanggi.ggpc.tbg</p>', 506, '2023-05-08 08:53:28', '2023-05-08 08:53:28'),
	(10, 'Upload Dokumen', '<p>Mohon untuk mengupload attachment ( File dokumen pendukung ) harus file dalam bentuk <i><strong>.PDF</strong></i></p>', 679, '2023-07-10 07:54:08', '2023-07-10 07:54:08'),
	(11, 'Announcement', '<p>Dear All User,</p><p>Apabila ada Registrasi New Code Material yang tidak di attach dokumen lampiran, maka akan di reject oleh Master Data</p>', 318, '2023-07-20 07:59:11', '2023-07-20 07:59:11');
